import styles from "./Portfolio.module.css"
import buddiz from "../assets/버디.jpg"
function Portfolio(){
    return(
        <>
            <div className={styles.container}>
                <h1>MY Portfolio</h1>
                <div className={styles.Portfolio}>
                    <img src={buddiz}/>
                </div>
            </div>
        </>
    )
}

export default Portfolio;
